(def sat-prob 
 (let [runs 10
       symbols 25]
  (for [num-clauses (range 0.5 8 0.5)]
    [num-clauses
     (/ (count (for [seed (range runs)
      	         :let [_ (set-jvm-seed seed)
                       clauses (generate (int (* num-clauses symbols)) 3 symbols)]
                 :when (dpll-satisfiable? clauses)]
                seed))
       runs)])))
