(def sat-iter 
 (let [runs 10
       symbols 25]
  (for [num-clauses (range 0.5 8 0.5)]
    [num-clauses
     (/ (reduce + (for [seed (range runs)
      	                :let [_ (set-jvm-seed seed)
                              _ (reset! counter 0)
                              clauses (generate (int (* num-clauses symbols)) 3 symbols)
                 	          _ (dpll-satisfiable? clauses)]]
                    @counter))
       runs)])))
